import React from "react";
import styles from "./styles.moodule.css";
import Item from "../utils/Item";

const Order = ({ order }) => (
  <div>
    <h2>Tu orden</h2>

    {order.map((product) => (
      <Item
        key={product.id}
        product={product}
        //            deletingProduct={deletingProduct}
      />
    ))}

    {order.map((product) => (
      <Item key={product.id} product={product} />
    ))}
  </div>
);

export default Order;
